import React from "react";
import { useLocation } from "react-router-dom";
import Container from "@mui/material/Container";
import Paper from "@mui/material/Paper";
import Divider from "@mui/material/Divider";
import { UserAlbums } from "../USER_PHOTOS/UserAlbum";
import UserPosts from "../USER_POSTS/UserPosts";
impo
const UserProfile = () => {
  const location = useLocation();

  return (
    <>
      <Container>
        <Paper elevation={3}>
          <div style={{ padding: "5px" }}>
            <h3 className=" userProfile_Headers">User Details</h3>
            <Divider />
            <ul>
              <p>Name: {location.state.userData.name}</p>
              <p>Email: {location.state.userData.email}</p>
              <p>Phone: {location.state.userData.phone}</p>
              <p>WebSite: {location.state.userData.website}</p>
            </ul>
          </div>
        </Paper>
        <UserPosts />
        <UserAlbums />
      </Container>
    </>
  );
};

export default UserProfile;
